import React, { Component } from "react"
import PcCard from "./PcCard"
import './PCs.css'

const PCs = ({pcs}) => {

  const displayCards = pcs.map(char => {
    return (
      <PcCard
        charName={char.charName}
        playerName={char.playerName}
        concept={char.concept} 
        image={char.image}
        key={Date.now}
      />
    )
  })

  return (
    <section>
      {displayCards}
    </section>
  )
}

export default PCs
